// Debug Cohere response
console.log("=== COHERE RESPONSE DEBUG ===");
console.log("Full response:", JSON.stringify($json, null, 2));
console.log("Response keys:", Object.keys($json));
console.log("Has 'embeddings'?", 'embeddings' in $json);
console.log("Type of embeddings:", typeof $json.embeddings);

if ($json.embeddings) {
  console.log("Embeddings length:", $json.embeddings.length);
  if ($json.embeddings[0]) {
    console.log("First embedding length:", $json.embeddings[0].length);
    console.log("First 5 values:", $json.embeddings[0].slice(0, 5));
  }
}

// Check for errors
if ($json.message) {
  console.log("ERROR from Cohere:", $json.message);
}

// Pass through the data
return [{ json: $json }];

// Expand the user's question with synonyms/variations
const question = $json.chatInput;

// Create multiple query variations
const expansions = [
  question,
  question + " please",
  "Tell me about " + question,
  "What is " + question,
  "Explain " + question
];

// Add synonyms for common words
if (question.includes("name")) {
  expansions.push(question.replace("name", "called"));
  expansions.push("What am I " + question);
}

if (question.includes("like")) {
  expansions.push(question.replace("like", "prefer"));
  expansions.push(question.replace("like", "enjoy"));
}

// Return all variations
return [{
  json: {
    original_question: question,
    expanded_queries: expansions,
    // Pass first 3 to Cohere (API limit)
    query_for_cohere: expansions[0],
    backup_queries: expansions.slice(1, 3)
  }
}];

// Debug what Google Sheets returns
const rows = $input.all();

console.log("=== GOOGLE SHEETS DEBUG ===");
console.log("Total rows:", rows.length);

if (rows.length > 0) {
  const firstRow = rows[0].json;
  console.log("First row keys:", Object.keys(firstRow));
  console.log("First row data:", JSON.stringify(firstRow, null, 2));

  // Check specific columns
  console.log("Has 'Content' field?", 'Content' in firstRow);
  console.log("Has 'content' field?", 'content' in firstRow);
  console.log("Has 'Embedding' field?", 'Embedding' in firstRow);
  console.log("Has 'embedding' field?", 'embedding' in firstRow);
}

// Return the data as-is for next node
return rows.map(row => ({json: row.json}));

// Calculate confidence based on search results
const searchResults = $json.top_results || [];
const question = $json.question;
const bestMatch = searchResults.length > 0 ? searchResults[0] : null;

// Calculate confidence score (0-1)
let confidence = 0.3; // Base confidence

if (bestMatch) {
  // Higher similarity = higher confidence
  confidence += bestMatch.combinedScore * 0.4;

  // More results = higher confidence
  confidence += Math.min(searchResults.length / 5, 0.2);

  // Longer match content = higher confidence
  confidence += Math.min(bestMatch.content.length / 100, 0.1);
}

// Cap at 1
confidence = Math.min(confidence, 1);

// Add confidence level text
let confidenceText = "";
if (confidence > 0.8) confidenceText = "High confidence";
else if (confidence > 0.5) confidenceText = "Moderate confidence";
else confidenceText = "Low confidence - may be inaccurate";

return [{
  json: {
    ...$json, // Pass through all previous data
    confidence_score: confidence,
    confidence_level: confidenceText,
    should_add_disclaimer: confidence < 0.6
  }
}];

// SAFE VERSION WITH ERROR HANDLING

// Get the Cohere response
const cohereResponse = $input.first().json;

console.log("DEBUG - Cohere response received");

// Check if embeddings exist
if (!cohereResponse || !cohereResponse.embeddings || !cohereResponse.embeddings[0]) {
  console.log("ERROR: No embeddings found in Cohere response");
  console.log("Cohere response:", JSON.stringify(cohereResponse, null, 2));

  // Return fallback context
  return [{
    json: {
      context: "I'm having trouble processing your question right now. Please try again.",
      question: $node['Basic Chat Trigger'].json.chatInput || "Unknown question",
      error: "No embeddings from Cohere"
    }
  }];
}

const questionEmbedding = cohereResponse.embeddings[0];
console.log("DEBUG - Embedding length:", questionEmbedding.length);

// Get knowledge from Google Sheets
const allKnowledge = $input.all() || [];
console.log("DEBUG - Knowledge rows:", allKnowledge.length);

// If no knowledge, return empty context
if (allKnowledge.length === 0) {
  return [{
    json: {
      context: "My knowledge base is currently empty. Please add some information first.",
      question: $node['Basic Chat Trigger'].json.chatInput,
      results_count: 0
    }
  }];
}

// SIMPLE KEYWORD SEARCH (skip embeddings for now)
const question = ($node['Basic Chat Trigger'].json.chatInput || "").toLowerCase();
console.log("DEBUG - Question:", question);

let matches = [];

// Simple keyword matching
allKnowledge.forEach(row => {
  const rowData = row.json;
  const content = rowData.Content || rowData.content || "";
  const contentLower = content.toLowerCase();

  // Count keyword matches
  const keywords = question.split(' ').filter(w => w.length > 2);
  let matchCount = 0;

  keywords.forEach(keyword => {
    if (contentLower.includes(keyword)) {
      matchCount++;
    }
  });

  if (matchCount > 0) {
    const matchScore = matchCount / Math.max(1, keywords.length);
    matches.push({
      content: content,
      score: matchScore,
      matchedWords: matchCount
    });
  }
});

// Sort by score
matches.sort((a, b) => b.score - a.score);
const topMatches = matches.slice(0, 3);

// Build context
let context = "";
if (topMatches.length > 0) {
  context = "Based on my knowledge:\n\n";
  topMatches.forEach((match, index) => {
    context += `${index + 1}. ${match.content}\n`;
  });
} else {
  context = "I don't have specific information about that in my knowledge base.\n";

  // Show some general knowledge
  const generalKnowledge = allKnowledge.slice(0, 3).map(row => {
    const content = row.json.Content || row.json.content || "";
    return content;
  }).filter(c => c.length > 0);

  if (generalKnowledge.length > 0) {
    context += "\nHere's what I know:\n";
    generalKnowledge.forEach((info, idx) => {
      context += `â€¢ ${info}\n`;
    });
  }
}

return [{
  json: {
    context: context,
    question: $node['Basic Chat Trigger'].json.chatInput,
    matches_found: topMatches.length,
    debug: {
      question_words: question.split(' '),
      total_knowledge: allKnowledge.length
    }
  }
}];

// Compress context to fit token limits
const context = $json.context;
const question = $json.question;
const confidence = $json.confidence_score || 0.5;

// Simple compression: take only most relevant parts
const lines = context.split('\n');
let compressed = "";
let lineCount = 0;

// Always include the question
compressed += `User asked: ${question}\n\n`;

// Include search results (limit based on confidence)
const maxLines = confidence > 0.7 ? 5 : 3;

lines.forEach(line => {
  if (lineCount < maxLines && line.trim().length > 10) {
    // Skip headers, include content
    if (!line.includes("ðŸ“š") && !line.includes("BASED ON")) {
      compressed += line + "\n";
      lineCount++;
    }
  }
});

// Add disclaimer if low confidence
if (confidence < 0.6) {
  compressed += "\nâš ï¸ Note: This information may not be fully accurate.";
}

return [{
  json: {
    ...$json,
    compressed_context: compressed,
    original_context_length: context.length,
    compressed_context_length: compressed.length
  }
}];
